    false,nt"url": null,nt"notes": "The database represents point locations
    and associated stand assessment data collected with known aspen stands in the Klamath
    National Forest, Siskiyou County, California. The associated Klamath National Forest
    Region 5 Existing Vegetation aspen layer (KLAMATH_NF_KNF_VEG_POLY) was derived from
    LANDSAT TM imagery, SPOT imagery, orthophotos, aerial photos and auxiliary layers
    (Source data: Region 5 Forestland And Resource Data Base GIS And Oracle Data Dictionary
    4/14/95'.) The stands were classified based upon conditions such as primary and
    dominant tree species, tree size, and tree density as determined by both the CALVEG
    system and California Wildlife Habitat Relationships system. Associated with this
    point layer is a polygon layer (KLAMATH_NF_KNF_VEG_POLY) containing aspen stands
    delineated in conjunction with the aspen assessment information. Data Compilation:
    The Aspen Delineation Project (ADP) is a collaborative effort of the U.S. Forest
    Service's Pacific Southwest Region, the California Department of Fish and Games
    Resource Assessment Program, and the California Office of Bureau of Land Management.
    Principal Investigator for ADP is David Burton; visit: www.aspensite.org for more
    information regarding the ADP. The Department of Fish and Games, Resource Assessment
    Program compiled this information from the collaborating agencies and other researchers,
    and formatted the data into a common database for the purpose of facilitating access
    to data related to the conservation of Quaking Aspen in California. This information
    portal falls within the ADP goals to help agencies and land managers identify, map,
    treat, and monitor aspen habitats. This dataset is a portion of a master database
    compiled during a year long effort in 2005 to pull together current GIS layers and
    maps depicting Aspen communities in California.",nt"owner_org": "467d900f-8a42-452d-9906-6610dd1a767f",nt"extras":
